<div class="et_pb_text_inner">
<h2>Pruszkowski Oddzial PTTK &#8222;Cirrus&#8221;</h2>
<p><span>Klub Cirrus powstal w Pruszkowie w maju 1965 roku. Na poczatku swojej dzialalnosci zajmowal sie szeroko pojeta turystyka wodna (takze kajakarstwem). Zeglarstwo w tradycji PTTK Cirrus nabralo wiekszego znaczenia pod koniec lat 70. i stanowi glowna domene Klubu juz od ponad 50 lat. (<span style="color: #073dbc;">czytaj cala historie)</span></span></p>
<p><span>W 2017 roku odbylo sie Walne Zebranie Oddzialu PTTK w Pruszkowie. Wybrano nowy zarzad, komisje rewizyjna i Sad Kolezenski. Nowym Prezesem Oddzialu zostal kpt. Marek Belniak.</span></p>
</div>
</div> <!-- .et_pb_text -->
</div> <!-- .et_pb_column -->


